// src/App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import ClubDashboard from './components/ClubDashboard';
import SeguidorDashboard from './components/SeguidorDashboard';
import './App.css';

function App() {
  const [userType, setUserType] = useState('');

  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" exact>
            <LoginForm setUserType={setUserType} />
          </Route>
          <Route path="/club/dashboard">
            {userType === 'club' ? <ClubDashboard /> : null}
          </Route>
          <Route path="/seguidor/dashboard">
            {userType === 'seguidor' ? <SeguidorDashboard /> : null}
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
